import nodeHtmlToImage from "node-html-to-image";
import fs from "node:fs";
import { tagsDisplayText } from "./src/content/tags";
import target_image from "./assets/gvplogo128.png";

const assetPath = "./testing";

const target_image_data = `data:image/png;base64,${new Buffer.from(fs.readFileSync(String(target_image))).toString("base64")}`;
const cursor_default = "data:image/png;base64,";
const cursor_pointer = "data:image/png;base64,";
const context_menu = "data:image/png;base64,";

const gvpReportHTML = fs.readFileSync("./htmlresources/gvp-report.html", "utf8");
const gvpReportCSS = fs.readFileSync("./htmlresources/gvp-report-style.css", "utf8");
const gvpRevealImageHTML = fs.readFileSync("./htmlresources/gvp-revealimage.html", "utf8");
const gvpRevealImageCSS = fs.readFileSync("./htmlresources/gvp-revealimage-style.css", "utf8");

const installMouseHelper = async (page, cursor_data) => {
    await page.evaluate((cursor) => {
        const box = document.createElement("puppeteer-mouse-pointer");
        const styleElement = document.createElement("style");
        styleElement.innerHTML = `
puppeteer-mouse-pointer {
    pointer-events: none;
    position: absolute;
    content: url(${cursor});
    top: 0;
    left: 0;
    z-index: 1;
    aspect-ratio: 1/1;
    height: 24px;
}
`;
        document.head.appendChild(styleElement);
        document.body.appendChild(box);
        document.addEventListener("mousemove", event => {
            box.style.left = `${event.pageX}px`;
            box.style.top = `${event.pageY}px`;
        });
    }, cursor_data);
};

if (!fs.existsSync(assetPath)) {
    fs.mkdirSync(assetPath);
}

nodeHtmlToImage({
    output: `${assetPath}/report3.png`,
    html: `
<html lang="en">
<body>
    ${gvpReportHTML}
    <style>${gvpReportCSS}</style>
</body>
</html>
`,
    transparent: true,
    selector: "#gvp-alert",
    beforeScreenshot: async page => {
        await installMouseHelper(page, cursor_pointer);
        await page.setViewport({ width: 1920, height: 1080 });
        await page.$eval("#gvp-report-preview-image", (node, logo) => node.src = logo, target_image_data);

        for (const [key, value] of tagsDisplayText) {
            await page.evaluate((tag, text) => {
                const tagsSection = document.querySelector(".gvp-tags-section");
                const container = document.createElement("div");
                container.className = "gvp-tag-container";

                const input = document.createElement("input");
                input.type = "checkbox";
                input.className = "gvp-checkbox";
                input.id = `gvp-${tag}-checkbox`;
                input.checked = true;

                const label = document.createElement("label");
                label.htmlFor = input.id;
                label.innerText = text;

                container.appendChild(input);
                container.appendChild(label);
                tagsSection.appendChild(container);
            }, key, value);
        }

        await page.hover(`#gvp-${tagsDisplayText.keys().next().value}-checkbox + label`);
        const node = await page.$("#gvp-alert");
        await node.screenshot({
            path: `${assetPath}/report2.png`,
            omitBackground: true,
        });

        await page.hover("#gvp-submit-button");
    },
});

nodeHtmlToImage({
    output: `${assetPath}/report5.png`,
    html: `
<html lang="en">
<body>
    ${gvpRevealImageHTML}
    <style>${gvpRevealImageCSS}</style>
</body>
</html>
`,
    transparent: true,
    selector: "#gvp-reveal-image",
    beforeScreenshot: async page => {
        await installMouseHelper(page, cursor_pointer);
        await page.setViewport({ width: 1920, height: 1080 });
        await page.$eval("#gvp-image-preview", (node, logo) => node.src = logo, target_image_data);

        const imageTagArray = [...tagsDisplayText.values()];
        await page.$eval("#gvp-image-preview-tags", (node, text) => node.textContent = text, imageTagArray.join(", "));
        for (const [key, value] of tagsDisplayText) {
            await page.evaluate((tag, text) => {
                const feedback = document.querySelector(".gvp-feedback-checkboxes");
                const tagbox = document.createElement("div");
                tagbox.className = "gvp-tagbox";

                const label = document.createElement("label");
                label.innerText = text;

                const reveal = document.createElement("div");
                reveal.className = "gvp-reveal-checkbox";

                const positive = document.createElement("img");
                positive.id = `gvp-positive-checkbox-${tag}`;
                positive.className = "gvp-positive-checkbox";

                const negative = document.createElement("img");
                negative.id = `gvp-negative-checkbox-${tag}`;
                negative.className = "gvp-negative-checkbox";
                negative.style.backgroundColor = "rgb(179, 0, 0)";

                reveal.appendChild(positive);
                reveal.appendChild(negative);
                tagbox.appendChild(label);
                tagbox.appendChild(reveal);

                feedback.appendChild(tagbox);
            }, key, value);
        }

        await page.hover(`#gvp-negative-checkbox-${tagsDisplayText.keys().next().value}`);
        let node = await page.$("#gvp-reveal-image");
        await node.screenshot({
            path: `${assetPath}/voting.png`,
            omitBackground: true,
        });

        await page.hover("#gvp-whitelist-checkbox");
        node = await page.$(".gvp-whitelist");
        await node.screenshot({
            path: `${assetPath}/whitelisting.png`,
            omitBackground: true,
        });

        await page.mouse.reset();
        await page.evaluate(() => {
            document.getElementById("gvp-user-feedback").remove();
        });
    },
});

nodeHtmlToImage({
    output: `${assetPath}/report4.png`,
    html: `
<html lang="en">
<body>
    <img id="gvp-filtered-image" src="" alt="" />
</body>
</html>
`,
    transparent: true,
    selector: "#gvp-filtered-image",
    beforeScreenshot: async page => {
        await installMouseHelper(page, cursor_pointer);
        await page.setViewport({ width: 1920, height: 1080 });

        await page.evaluate(() => {
            const width = 960;
            const height = 540;

            const canvas = document.createElement("canvas");
            canvas.width = width;
            canvas.height = height;

            const canvasContext = canvas.getContext("2d");
            if (canvasContext) {
                const gradient = canvasContext.createLinearGradient(0, 0, width, height);
                gradient.addColorStop(0, "rgb(10,10,10)");
                gradient.addColorStop(1, "rgb(55,55,55)");
                canvasContext.fillStyle = gradient;
                canvasContext.fillRect(0, 0, width, height);
            }

            document.getElementById("gvp-filtered-image").src = canvas.toDataURL("image/png");
        });

        await page.hover("#gvp-filtered-image");
    },
});

nodeHtmlToImage({
    output: `${assetPath}/report1.png`,
    html: `
<html lang="en">
<body>
    <div id="gvp-context" style="width: 360px; height: 320px;">
        <img id="gvp-image" src="{{target}}" alt="" />
        <img id="gvp-context-menu" style="position: absolute; z-index: 1;" src="{{context}}" alt="" />
    </div>
</body>
</html>
`,
    transparent: true,
    selector: "#gvp-context",
    beforeScreenshot: async page => {
        await installMouseHelper(page, cursor_pointer);
        await page.setViewport({ width: 1920, height: 1080 });

        await page.evaluate(() => {
            const rect = document.getElementById("gvp-image").getBoundingClientRect();

            const box = document.getElementById("gvp-context-menu");
            box.style.top = String(rect.x + (rect.width * 0.5));
            box.style.left = String(rect.y + (rect.height * 0.5));

            const pointer = document.querySelector("puppeteer-mouse-pointer");
            pointer.style.zIndex = 2;
        });

        const target = await page.$eval("#gvp-context-menu", node => {
            const rect = node.getBoundingClientRect();
            return {
                x: rect.x + (rect.width * 0.5), // left + midpoint
                y: rect.y + rect.height - (36 * 0.5), // top + height - element midpoint
            };
        });
        await page.mouse.move(target.x, target.y);
    },
    content: { target: target_image_data, context: context_menu },
});
